// Private Class Hiding Macros
#define MOXACLASSBASED_DECLARE_PRIVATE(Class) \
    inline Class##Private* d_func() { return reinterpret_cast<Class##Private *>(d_ptr); } \
    inline const Class##Private* d_func() const { return reinterpret_cast<const Class##Private *>(d_ptr); } \
    friend class Class##Private; \
    Class##Private *d_ptr;

#define MOXACLASSBASED_DECLARE_PUBLIC(Class) \
    inline Class* q_func() { return static_cast<Class *>(q_ptr); } \
    inline const Class* q_func() const { return static_cast<const Class *>(q_ptr); } \
    friend class Class;

#define MOXACLASSBASED_D(Class) Class##Private * const d = d_func()
#define MOXACLASSBASED_CD(Class) const Class##Private * const d = d_func()
#define MOXACLASSBASED_Q(Class) Class * const q = q_func()

